import React, { Component } from 'react';
import './App.css';

import Alarm from './components/alarm/Alarm';

class App extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-2">
            <div className="tile">hi guy</div>
          </div>
        </div>
        <Alarm />
      </div>
    );
  }
}

export default App;
